const Navbar = (props) => {

  const style = {
    background: "rgba(0,0,0,0.1)",
    height: "48px",
    paddingTop: "0px",
    paddingBottom: "0px",
  }
  
  return (
    <nav className="nav-wrapper" style={style}>
      <div className="container">
        <a className="brand-logo center" style={{fontSize: "24px"}}>kanban</a>
      </div>
    </nav>
  )
}

export default Navbar;
